import User from "../models/User";

let keyContainer = ["1","2","3","4","5"];

// Global
export const postJoin = async (req, res) => {
    const { name, email, password, confirmPassword, key } = req.body;;
    try {
        if(!name || !email || !password || !confirmPassword || !key) {
            return (
                res.json({ 
                    success: false,
                    message: "ëª¨ë“  ì •ë³´ë¥¼ ìž…ë ¥í•´ì£¼ì„¸ìš”ðŸ˜…" 
                })
            )
        }
        const existedUser = await User.findByEmail(email)
        if(existedUser) {
            return (
                res.json({ 
                    success: false,
                    message: "ì´ë¯¸ ê°€ìž…ëœ ì´ë©”ì¼ìž…ë‹ˆë‹¤ðŸ˜…"
                })
            )
        }
        if(password !== confirmPassword) {
            return (
                res.json({ 
                    success: false,
                    message: "ë¹„ë°€ë²ˆí˜¸ê°€ ì¼ì¹˜í•˜ì§€ ì•ŠìŠµë‹ˆë‹¤ðŸ˜…"       
                })
            )
        }
        if(keyContainer.indexOf(key) < 0) {
            return (
                res.json({
                    success: false,
                    message: "ë“±ë¡ë˜ì§€ ì•Šì€ ì œí’ˆë²ˆí˜¸ìž…ë‹ˆë‹¤ðŸ˜…"
                })
            )
        }
        const keyfilter = keyContainer.filter(index => index !== key);
        keyContainer = keyfilter;
        const user = new User({
            email,
            name,
            key,
            avatar: "null"
        });
        await user.setPassword(password);
        await user.save();
        res.status(200)
            .json({ success: true })
    } catch(err) {
        console.log(err);
    }
};

export const postLogin = async (req, res) => {
    const { email, password } = req.body;
    try {
        const user = await User.findByEmail(email);
        if(!email || !password) {
            res.json({ 
                success: false,
                message: "ì´ë©”ì¼ê³¼ ë¹„ë°€ë²ˆí˜¸ë¥¼ ìž…ë ¥í•´ì£¼ì„¸ìš”ðŸ˜…"
            });
            return;
        }
        if(!user) {
            res.json({ 
                success: false,
                message: "ì¡´ìž¬í•˜ì§€ ì•ŠëŠ” ì´ë©”ì¼ìž…ë‹ˆë‹¤ðŸ˜…"
            });
            return; 
        }
        const checkPassword = await user.checkPassword(password);
        if(!checkPassword) {
            res.json({ 
                success: false,
                message: "ë¹„ë°€ë²ˆí˜¸ë¥¼ í™•ì¸í•´ì£¼ì„¸ìš”ðŸ˜…"
            });
            return;
        }
        user.serialize();
        const token = await user.generateToken(user);
        user.save();
        res.cookie('access_token', token, {
            maxAge: 1000 * 60 * 60 * 24 * 7,
            httpOnly: true
        })
            .status(200)
            .json({ 
                success: true,
                userId: user.id    
            });
    } catch(err) {
        console.log(err);
    };
};

export const auth = (req, res) => {
    const {
        user: {
            id,
            name,
            email,
            key
        }
    } = req;
    res.status(200)
        .json({
            id,
            name,
            email,
            key,
            isAuth: true
        });
};

export const logout = async (req, res) => {
    const {
        user: { _id: id }
    } = req;
    try {
        const user = await User.findByIdAndUpdate(id, {token: ""});
        user.save();
        res.cookie('access_token', "")
            .status(200)
            .json({ 
                success: true,
                isAuth: false
            });
    } catch(err) {
        res.json({ 
            success: false, 
            err 
        });
    } 
};
